import connect from "./connect";
import onConnected from "./onConnected";
import onError from "./onError";

const registerUser = (
  stompClient,
  setUserData,
  userData,
  privateChats,
  setPrivateChats,
  publicChats,
  setPublicChats) => {   
  connect(() => onConnected(
    setUserData,
    stompClient,
    userData,
    privateChats,
    setPrivateChats,
    publicChats,
    setPublicChats),
    onError,
    stompClient);
};

export default registerUser;
